import "./style.css";

function App() {
  return (
    <header class="header">
      <div class="logo">
        <img src="logo.png" height="68" width="68" alt="Today I Learned Logo" />
        <h1>Today I Learned</h1>
      </div>
      <button class="btn btn-large btn-open">Share a fact</button>
    </header>
  );
}

function CategoryFilters() {
  return <aside>Category Filter</aside>;
}

export default App;
